import React from "react";

function Footer() {
  return (
    <div className="footer">
      <footer className="bg-dark fixed-bottom">
        <div className="container">
          <p className="m-0 text-center text-white">
            Copyright &copy; Mike Kowols 2020
          </p>
        </div>
      </footer>
    </div>
  );
}

export default Footer;
